import './App.css';

import ButtonPink from "./components/ButtonPink";
import ButtonWhite from "./components/ButtonWhite";
import PriceFree from "./components/PriceFree";
import PricePro from "./components/PricePro";
import PriceEnterprise from "./components/PriceEnterprise";

function App() {
  return (
    <div className="App">
      <ButtonPink />
      <ButtonWhite />
      <PriceFree />
      <PricePro />
      <PriceEnterprise />
    </div>
  );
}

export default App;
